import React from 'react';
import './App.css';
import PredictionComponent from './PredictionComponent';
import CameraComponent from './CameraComponent'; // Import the Camera component

const App = () => {
    return (
        <div className="App">
            <CameraComponent /> {/* Display the camera feed */}
            <PredictionComponent />
        </div>
    );
};

export default App;
